/**
 * Enum for tri-state values.
 * @enum {number}
 */
var TriState = {
    /** true */
    TRUE: 1,
    FALSE: -1,
    /** @type {boolean} */
    MAYBE: true
};

/**
 * Numeric enum for true/false values.
 * @enum {boolean}
 */
var TrueFalseNumeric = {
    /** false */
    0: false,
    1: true
};
